import React from 'react';
import {Link} from 'react-router-dom'

const Header=()=>(
  <ul>
    <li><Link to="/"></Link></li>
    <li><Link to="/component2"></Link></li>
    <li><Link to="/component3"></Link></li>
  </ul>
)

export default Header;
